import React from "react";
import { useNavigate } from "react-router-dom";
import "../MenuPrincipal.css";

export default function MenuPrincipal() {
  const navigate = useNavigate();

  return (
    <div className="menu-container" style={{ backgroundImage: "url('/ELEAM.png')" }}>
      <div className="menu-panel">
        <div className="menu-header">
        <div className="logo" style={{ backgroundImage: "url('/image.png')" }}></div>
            <span className="menu-titulo">Red ELEAM</span>
          </div>
        </div>

        <div className="menu-bienvenida">
          <h1>Te damos la bienvenida!</h1>
          <p>Seleccione el módulo al que desea ingresar</p>
        </div>

        <div className="menu-botones">
          <button onClick={() => navigate("/ficha-clinica")}>FICHA CLÍNICA</button>
          <button onClick={() => navigate("/signos-vitales")}>SIGNOS VITALES</button>
          <button onClick={() => navigate("/parametros-clinicos")}>PARÁMETROS CLÍNICOS</button>
          <button onClick={() => navigate("/gestion-personal")}>GESTIÓN DE PERSONAL</button>
          <button onClick={() => navigate("/medicamentos")}>MEDICAMENTOS</button>
          <button onClick={() => navigate("/liquidacion-pagos")}>LIQUIDACIÓN Y PAGOS</button>
        </div>
      </div>
  );
}
